def count(chessBoard):
	n = len(chessBoard)
	res = {x: 0 for x in range(1, n + 1)}
	dp = [[0 for i in range(n)] for j in range(n)]
	for i in range(n):
		for j in range(n):
			if (i == 0 or j == 0) and chessBoard[i][j] == 1:
				dp[i][j] = 1
	for i in range(1, n):
		for j in range(1, n):
			if chessBoard[i][j] == 1:
				dp[i][j] = min(dp[i - 1][j - 1], dp[i - 1][j], dp[i][j - 1]) + 1
				for k in range(2, dp[i][j] + 1):
					res[k] += 1
	return {k: v for k, v in res.items() if v and k > 1}





